CKEDITOR.plugins.setLang("a11yhelp","nb",{title:"Instruksjoner for tilgjengelighet",contents:"Innhold for hjelp. Trykk ESC for \xe5 lukke denne dialogen.",legend:[{name:"Generelt",items:[{name:"Verkt\xf8ylinje for editor",legend:"Trykk ${toolbarFocus} for \xe5 navigere til verkt\xf8ylinjen. Flytt til neste og forrige verkt\xf8ylinjegruppe med TAB og SHIFT-TAB. Flytt til neste og forrige verkt\xf8ylinjeknapp med H\xd8YRE PILTAST og VENSTRE PILTAST. Trykk MELLOMROM eller ENTER for \xe5 aktivere verkt\xf8ylinjeknappen."},{name:"Dialog for editor",legend:"Mens du er i en dialog, trykk TAB for \xe5 navigere til neste dialogfelt, press SHIFT + TAB for \xe5 flytte til forrige felt, trykk ENTER for \xe5 akseptere dialogen, trykk ESC for \xe5 avbryte dialogen. For dialoger med flere faner, trykk ALT + F10 for \xe5 navigere til listen over faner. G\xe5 til neste fane med TAB eller H\xd8YRE PILTAST. G\xe5 til forrige fane med SHIFT + TAB eller VENSTRE PILTAST. Trykk MELLOMROM eller ENTER for \xe5 velge fanen."},{name:"Kontekstmeny for editor",legend:"Trykk ${contextMenu} eller MENYKNAPP for \xe5 \xe5pne kontekstmeny. G\xe5 til neste alternativ i menyen med TAB eller PILTAST NED. G\xe5 til forrige alternativ med SHIFT+TAB eller PILTAST OPP. Trykk MELLOMROM eller ENTER for \xe5 velge menyalternativet. \xc5pne undermenyen p\xe5 valgt alternativ med MELLOMROM eller ENTER eller H\xd8YRE PILTAST. G\xe5 tilbake til overordnet menyelement med ESC eller VENSTRE PILTAST. Lukk kontekstmenyen med ESC."},{name:"Listeboks for editor",legend:"I en listeboks, g\xe5 til neste alternativ i listen med TAB eller PILTAST NED. G\xe5 til forrige alternativ i listen med SHIFT + TAB eller PILTAST OPP. Trykk MELLOMROM eller ENTER for \xe5 velge alternativet i listen. Trykk ESC for \xe5 lukke listeboksen."},{name:"Verkt\xf8ylinje for elementsti",legend:"Trykk ${elementsPathFocus} for \xe5 navigere til verkt\xf8ylinjen som viser elementsti. G\xe5 til neste elementknapp med TAB eller H\xd8YRE PILTAST. G\xe5 til forrige elementknapp med SHIFT+TAB eller VENSTRE PILTAST. Trykk MELLOMROM eller ENTER for \xe5 velge elementet i editoren."}]},{name:"Hurtigtaster",items:[{name:"Angre",legend:"Trykk ${undo}"},{name:"Gj\xf8r om",legend:"Trykk ${redo}"},{name:"Fet tekst",legend:"Trykk ${bold}"},{name:"Kursiv tekst",legend:"Trykk ${italic}"},{name:"Understreking",legend:"Trykk ${underline}"},{name:"Lenke",legend:"Trykk ${link}"},{name:"Skjul verkt\xf8ylinje",legend:"Trykk ${toolbarCollapse}"},{name:"G\xe5 til forrige fokusomr\xe5de",legend:"Trykk ${accessPreviousSpace} for \xe5 komme til n\xe6rmeste fokusomr\xe5de f\xf8r skrivemark\xf8ren som ikke kan n\xe5s p\xe5 vanlig m\xe5te, for eksempel to tilst\xf8tende HR-elementer. Gjenta tastekombinasjonen for \xe5 komme til fokusomr\xe5der lenger unna i dokumentet."},{name:"G\xe5 til neste fokusomr\xe5de",legend:"Trykk ${accessNextSpace} for \xe5 komme til n\xe6rmeste fokusomr\xe5de etter skrivemark\xf8ren som ikke kan n\xe5s p\xe5 vanlig m\xe5te, for eksempel to tilst\xf8tende HR-elementer. Gjenta tastekombinasjonen for \xe5 komme til fokusomr\xe5der lenger unna i dokumentet."},{name:"Hjelp for tilgjengelighet",legend:"Trykk ${a11yHelp}"}]}]});